        corpo: "Ingredientes: <br><br> 1 posta de bacalhau;<br> 6 camarões;<br> 1 pimentão verde;<br> 1 pimentão amarelo;<br> 1 pimentão vermelho;<br> 2 talos de salsinha;<br> 4 tomates;<br> 1 cebola;<br> Curry;<br> 1 colher de colorau;<br> Açafrão;<br> Cominho em pó a gosto;<br> Pimenta do reino a gosto;<br> 1/2 pimenta dedo de moça;<br> 2 leites de coco;<br> 6 dentes de alho;<br> 1 folha de louro;<br> 1 colher de azeite de dendê;<br> 130g de farinha de mandioca.<br><br> Modo de preparo: <br><br> 1) Amasse o alho e ponha para fritar com um fio de azeite. Faça o mise em place dos pimentões, das cebolas (meia lua), dos tomates e retire as cascas dos camarões. Coloque as cascas dos camarões junto do alho e adicione as cebolas e uma colher de colorau. Refogue por 30 segundos e adicione os pimentões e os tomates; <br><br> 2) Coloque a posta de bacalhau, dividida em dois, e o leite de coco. Deixe ferver por 10 minutos e adicione o azeite de dendê e o sal. Limpe e grelhe os camarões;<br><br> 3) Para a farofa de azeite de bacon, coloque 3 colheres de azeite, 1 de manteiga e assim que o bacon dourar, retire e adicione a farinha de mandioca.",
