        corpo: "Ingredientes:<br><br>15 ovos;<br>10 colheres de farinha de trigo;<br>25 colheres de açúcar;<br>2 unidades de laranja;<br>2 caixas de morangos;<br>1 caixa de framboesa;<br>1 fava de baunilha;<br>500 ml de leite;<br>Pimenta;<br>Modo de preparo:<br><br>Pão de ló:<br>Para cada ovo, uma colher de farinha de trigo e uma colher de açúcar. Separe 10 claras de 10 gemas. Bata as claras até o ponto de clara em neve. Adicione as 10 gemas até atingir a textura de suflê. Adicione 10 colheres de açúcar e bata até baixar o suflê. Incorpore a farinha de trigo peneirada, delicadamente, para não desmanchar a clara em neve. Leve ao forno a 180º por 35 minutos.<br><br>Crème patissière:<br>Para cada 100 ml de leite, 1 gema de ovo e 1 colher de açúcar. Adicione também uma fava de baunilha raspada na panela e uma colher de farinha de trigo. Mexa até atingir o ponto.<br><br>Calda de laranja:<br>Esprema as duas laranjas em uma panela em fogo baixo. Deixe ferver com açúcar. Adicione quatro morangos e uma pitada de pimenta. Deixe ferver novamente e reserve.<br><br>Framboesas e morango:<br>Ferva as framboesas em uma panela em fogo baixo, com água e açúcar. Reserve. Lave os morangos, pique em cinco pedaços e leve à geladeira. Reserve.<br><br>Merengue:<br>Faça um merengue. Para cada clara, coloque três colheres de açúcar. Bata e reserve na geladeira.<br><br>Montagem:<br>Tire a tampa de cima do pão de ló e use só a borda. Regue com calda de laranja e depois com a calda de framboesa. Na parte de baixo, adicione os morangos que estavam na geladeira. Pegue o crème patissière, leve à batedeira e depois passe em cima dos morangos.<br>Coloque a parte de cima do bolo, regada com as caldas. Tire da geladeira o merengue e cubra o bolo, por cima e por volta. Pegue o maçarico e dê uma queimada no merengue. Pegue os morangos que sobraram, salteie-os na frigideira com açúcar e os utilize para decorar o bolo.",
